import React from 'react';

class SearchResults extends React.Component {

   displayVideos = () => {
      console.log(this.props.videos)

      const video2 = this.props.videos.map = (video) => {
         video.snippet.desription;
      }

      return video2;
   }

   render() {
      return (
         <div>
            Search Results
            {this.displayVideos()}
         </div>
      );
   }
}

export default SearchResults;
